import React from 'react'

function Login() {
    return (
        <div>
            <h3>Đăng nhập</h3>
            <form action="">
                <input type="checkbox" class="form-check-input" />
                <button className="btn btn-primary">Đăng nhập</button>
            </form>
        </div>
    );
}

export default Login;
